import React, { useEffect, useState } from "react";
import { Config } from "../../constant/Index";
import "./popup.css";

function Popup(props) {
  const [data, setData] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch(`${Config.serverUrlProduct}/${props.id}`);
        const jsonData = await response.json();
        setData(jsonData.data);
        setLoading(false);
        console.log(data);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };
    fetchData();
  }, [props.id]);

  const closePopup = () => {
    const popup = document.getElementById("popup");
    if (popup) {
      popup.style.visibility = "hidden";
    }
  };

  if (loading || !data) {
    return null; // You can modify this to show a loading indicator or fallback content
  }

  return (
    <>
      <div className="card__popup" id="popup">
        <i
          className="fa-solid fa-xmark crossicon"
          id="crossicon"
          onClick={closePopup}
        />
        <div className="popup__product">
          <div className="popup__content">
            <img
              className="popupimg"
              src={data.image}
              alt="Product_imgage"
            />
            <h1 className="popup__title">{data.title}</h1>
            <p className="paragraph">{data.description}</p>
            <div className="add__remove">
              <div className="plus">
                <i className="fa-solid fa-plus" />
              </div>
              <span className=""> 1 </span>
              <div className="minus">
                <i className="fa-solid fa-minus" />
              </div>
            </div>
            <h2 className="popup__price">
              Product Price:
              <span> ${data.price} </span>
              <div className="btns">
                <a href="#" className="btn">
                  Add to Cart
                </a>
                <a href="#" className="btn">
                  Order Now
                </a>
              </div>
            </h2>
          </div>
          <div className="accessories">
            <div className="radios">
              <div className="radio">
                <input type="radio" name="Large" />
                <label htmlFor="input"> Large </label>
              </div>
              <div className="radio">
                <input type="radio" name="Large" />
                <label htmlFor="input"> Medium </label>
              </div>
              <div className="radio">
                <input type="radio" name="Large" />
                <label htmlFor="input"> Small </label>
              </div>
            </div>
            <div className="accessory">
              <span> Product Accessories </span>
              <div className="input__accessories">
                {/* Add code to display product accessories */}
              </div>
            </div>
          </div>
        </div>
        <div className="review__section">
          <div className="btn__title">
            <h1 className="review__title">Product Review</h1>
            <a href="review.html" className="btn">
              Give Your Review
            </a>
          </div>
          {/* Add code to display product reviews */}
        </div>
      </div>
    </>
  );
}

export default Popup;
